import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminDashboard = () => {
  const [summary, setSummary] = useState({});
  const [users, setUsers] = useState([]);
  const [courses, setCourses] = useState([]);
  const [assessments, setAssessments] = useState([]);
  const [submissions, setSubmissions] = useState([]);

  const userId = localStorage.getItem("userId"); // Admin user ID

  useEffect(() => {
    fetchSummary();
    fetchUsers();
    fetchCourses();
    fetchAssessments();
    fetchSubmissions();
  }, []);

  const fetchSummary = async () => {
    const res = await axios.get(`http://localhost:5000/api/admin/summary?userId=${userId}`);
    setSummary(res.data);
  };

  const fetchUsers = async () => {
    const res = await axios.get(`http://localhost:5000/api/admin/users?userId=${userId}`);
    setUsers(res.data);
  };

  const fetchCourses = async () => {
    const res = await axios.get(`http://localhost:5000/api/admin/courses?userId=${userId}`);
    setCourses(res.data);
  };

  const fetchAssessments = async () => {
    const res = await axios.get(`http://localhost:5000/api/admin/assessments?userId=${userId}`);
    setAssessments(res.data);
  };

  const fetchSubmissions = async () => {
    const res = await axios.get(`http://localhost:5000/api/admin/submissions?userId=${userId}`);
    setSubmissions(res.data);
  };

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>

      {/* Summary Cards */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4 mb-8">
        <Card title="Users" value={summary.totalUsers} />
        <Card title="Courses" value={summary.totalCourses} />
        <Card title="Assessments" value={summary.totalAssessments} />
        <Card title="Submissions" value={summary.totalSubmissions} />
      </div>

      {/* Tables */}
      <Section title="Users" data={users} columns={["fullName", "email", "role"]} />
      <Section title="Courses" data={courses} columns={["title", "description"]} />
      <Section title="Assessments" data={assessments} columns={["title", "courseId"]} />
      <Section title="Submissions" data={submissions} columns={["userId", "assessmentId", "score"]} />
    </div>
  );
};

const Card = ({ title, value }) => (
  <div className="bg-white rounded-2xl shadow p-4 text-center">
    <p className="text-gray-500">{title}</p>
    <p className="text-2xl font-semibold">{value ?? 0}</p>
  </div>
);

const Section = ({ title, data, columns }) => (
  <div className="mb-10">
    <h2 className="text-xl font-semibold mb-2">{title}</h2>
    <div className="overflow-x-auto">
      <table className="min-w-full border bg-white shadow rounded-2xl">
        <thead>
          <tr className="bg-gray-100">
            {columns.map((col) => (
              <th key={col} className="px-4 py-2 text-left capitalize">
                {col}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data?.length > 0 ? (
            data.map((item, idx) => (
              <tr key={idx} className="border-t">
                {columns.map((col) => (
                  <td key={col} className="px-4 py-2">
                    {item[col]?.title || item[col]?.fullName || item[col] || "-"}
                  </td>
                ))}
              </tr>
            ))
          ) : (
            <tr>
              <td className="px-4 py-2" colSpan={columns.length}>
                No data found.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  </div>
);

export default AdminDashboard;
